# ### Section I-1: Signals, Filters, and Convolution in Discrete Time
# The FFT is quite possibly THE fundamental algorithm of digital signal processing(DSP). For this presentation, we will assume that the signals we will be dealing with are discrete time signals, i.e. ones that occur at discrete(and also finite in the case of the DFT/FFT) time intervals. Going forward, we need to know the following definitions: <br>
# $\textbf{Signal(Discrete-Time)}$: A discrete time signal is a complex-valued sequence $\{x_n\}_{n \in \mathbb{N}}$ that represents some real-world quantity after it has been sampled(Section II-4). n is the time variable, which specifies the sample number. <br>
# $\textbf{Filter}$: A filter is anything that manipulates an incoming signal based on the frequency of the signal. A linear filter is described mathematically as a function of time by the sequence $\{h_n\}_{n \in \mathbb{N}}$. If $\{h_n\}$ is finite, then the filter is called a finite impulse response(FIR) filter, and the filter can be represented mathematically as a matrix. If $\{h_n\}$ is infinite, then the filter is called a ininfite impulse response(IIR) filter.
# 
# 
# 
#     

# <div>
# <img src="data:image/png;base64," width="360", height='100', align='center'/>
# </div>

# $\textbf{Convolution}$: Assume that the filter $\{h_n\}$ can be represented by some linear operator(i.e. matrix or polynomial coefficients). Then, the output $\{y_n\}$ of the filter is defined by the convolution of $\{h_n\}$ with the input $\{x_n\}$, which is denoted by $y_n = h_n \ast x_n$ and given by <br>
# $$y_n = \sum\limits_{k= -\infty}^{+\infty}x_kh_{n-k}$$ <br>
# This can be thought of as the result of "blending" $\{x_n\}$ and $\{h_n\}$. The indexing n - k must be done modulo N in the case of finite-length $\{x_n\}$ and $\{h_n\}$<br>
# Note that this is the same as the definition of the Cauchy Product of two power series: Let $A(z) = \sum\limits_{n=0}^{\infty}a_nz^n, B(z) = \sum\limits_{n=0}^{\infty}b_nz^n$. Then, C(z) = A(z)B(z) is given by 
# $$C(z) = \sum\limits_{n=0}^{\infty}c_nz^n \text{ where } c_n = \sum\limits_{k=0}^na_kb_{n-k}$$ <br>
# If $A(z),B(z)$ are finite sums, then the above product, described by the operation of convolution, is the product of two polynomials in z. <br>
# Computing the output sequence $\{y_n\}_{n=0}^{N-1}$ is clearly has a time complexity of $O(N^2)$. Assuming that $\{h_n\}$ is FIR, it is only necessary to store the filter coefficients $\{h_n\}_{n=0}^{K}$ where K does not necessarily equal N. This is computationally expensive for large N. In fact, if real digital signals were processed this way, LTE technology(among many other things, including Praveen's horseback riding radios) would not be possible. Thus, if we are to process large amounts of data quickly(and have Praveen's horseback riding radios, among many other things), we will need a better algorithm to compute $\{y_n\}$. To do this, we will, of course, first need to review some maths.
# ### Section I-2: Enter Linear Algebra
# If we are instead working with finite-length signals, the convergence of sequences and series is guaranteed and much of the math can be described in the language of matrices and vectors. <br>
# $\textbf{Definition(Finite-Dimensional Hilbert Space):}$ A finite-dimensional Hilbert space H is a finite-dimensional vector space that is equipped with an inner product operation $<\cdot,\cdot>$ that defines an associated norm $\lVert \cdot \rVert$ on H as follows: For $X \in H, \lVert X \rVert = \sqrt{<X,X>}$. Moreover, the inner product $<\cdot, \cdot>$ must satisfy the following properties: Let $X,Y,Z \in H$ and let $\alpha,\beta$ be scalars
# \begin{align}
#     &1.\text{(Symmetry):} <X,Y> = <Y,X> \\
#     &2.\text{(Positive-Definiteness):} \lVert X \rVert = 0 \iff X \equiv 0 \text{ and } <X,X> > 0 \text{ if } X \neq 0 \\
#     &3.\text{(Linearity in Both Variables):} <\alpha X + \beta Y, Z> = \alpha <X,Z> + \beta <Y,Z>
# \end{align}
# The finite-dimensional Hilbert space we are most concerned about in this presentation is $\mathbb{C}^n$ where n is a positive integer. This is the space of n-dimensiuonal vectors with complex entries, or the space of finite-length complex signals. The inner product of $z, w \in \mathbb{C}^n$ is given by <br>
# $$<z,w> = z_1\overline{w_1} + ... + z_n\overline{w_n}$$ <br>
# where $\overline{z}$ denotes complex conjugation. <br>
# $\textbf{Definition(Orthogonal/Orthonormal Set of Vectors):}$ Let $\{v_1, ... , v_n\}$ be a set of vectors in a finite-dimensional Hilbert space H. If $<v_i,v_j> = 0 \text{ whenever } i \neq j$, then $\{v_1, ... , v_n\}$ is an orthogonal set of vectors in H. If additionally the $v_i's$ are linearly independent, then $\{v_1, ... , v_n\}$ is an orthogonal basis for H. Moreover, if all of the $v_i's$ are of unit magnitude, then $\{v_1, ... , v_n\}$ is an orthonormal basis for H. <br>
# $\textbf{Theorem(Gram-Schmidt Process)}:$ Let $H$ be a nontrivial finite-dimensional Hilbert space. Then, H is guaranteed to have an orthogonal basis. Moreover, given an arbitrary basis $\{v_1, ... , v_n\}$ of H, an orthogonal basis $\{u_1,...,u_n\}$ can be obtained from $\{v_1, ... , v_n\}$ using
# \begin{align}
#     &u_1 = v_1 \\
#     &u_2 = v_2 - \frac{<v_2,u_1>}{<u_1,u_1>}u_1 \\
#     &\vdots \\
#     &u_n = v_n - \frac{<v_n,u_{n-1}>}{<u_{n-1},u_{n-1}>}u_{n-1} - ... - \frac{<v_n,u_1>}{<u_1,u_1>}u_1
# \end{align}
# The Gram-Schmidt Process can be used to define a concept of "best approximation" in the Hilbert space H with respect to the norm $\lVert \cdot \rVert$.<br>
# $\textbf{Theorem(Best Approximation)}$: Let H be a finite dimensional Hilbert space with inner product $<\cdot,\cdot>$ and associated norm $\lVert \cdot \rVert$. Let $\{u_1,...,u_n\}$ be an orthonormal basis of H and let $x \in H$. Let <br>
# $$p = \sum\limits_{j=1}^{n}\gamma_ju_j \text{ where } \gamma_j = <x,u_j>$$ <br>
# Then, p is the element of H that best approximates x with respect to $\lVert \cdot \rVert$. In other words, for any $y \in H,$ <br>
# $$\lVert x - p \rVert < \lVert y - x \rVert$$
# 

# ## Section II: The Discrete Fourier Transform(DFT)
# ### Section II-1: The Discrete Time Fourier Transform(DTFT) and Hints of Fourier Analysis
# Remember that n is a time variable. Therefore, explicitly computing the convolution is a time domain operation. What if we were to transform $\{h_n\}$ and $\{x_n\}$ into functions of a frequency variable, compute the convolution $x_n \ast h_n$  in the frequency domain, and then trasnform the result back into the time domain to obtain $\{y_n\}$? The operation that does this is called the $\text{Fourier transform}$. The Fourier transform is part of a fascinating area of mathematics called $\text{harmonic analysis}$. There exists a Fourier transform in both continuous and discrete time. We will focus on the discrete time Fourier transform(DTFT) and its finite version, called the discrete Fourier transform(DFT). The fast Fourier transform(FFT) is a class of efficient aglorithms for computing the DFT. Before we give a formula for the DFT is, we need to define the discrete-time Fourier transform(DTFT) and how the DFT is obtained from it. <br>
# $\textbf{Definition(DTFT)}$: Let $\{x_n\}_{n \in \mathbb{N}}$ be a sequence of complex numbers. The discrete time Fourier transform(DTFT) of $\{x_n\}$, denoted $X(e^{i\omega})$, is, assuming the series converges, given by <br>
# $$X(e^{i\omega}) = \sum\limits_{n = -\infty}^{+\infty}x_ne^{-i\omega n} $$  <br>
# where $\omega$ is a real variable defined on any closed interval of length $2 \pi$, often chosen as $[-\pi,\pi]$, which we will also do for the rest of this discussion. The $e^{i\omega}$ is used in the notation to denote that $X(e^{i\omega})$ is defined in the discrete-time frequency domain, or frequencies restricted to the interval $[-\pi,\pi]$. This is different from the continous-time frequency domain, which is all frequencies $\omega$ defined on the real line. This distinction will be explained further in Section $II-4$. <br>
# <br>
# $\textbf{Remark}$: The DTFT definition above is commonly given in most electrical engineering texts such as Oppenheim and Wilsky's $\textit{Signals and Systems}$. The above definition is actually the definition of the Fourier series representation of a Riemann-integrable function given in most math textbooks, such as Walter Rudin's $\textit{Principles of Mathematical Analysis}$ and Elias Stein's and Rami Shakarchi's $\textit{Fourier Analysis}$.<br>
# <br>
# Remark: The sequence of functions $\{e^{i\omega n}\}_{n \in \mathbb{Z}}$ forms an $\text{infinite dimensional}$ basis for the $\textit{infinite dimensional Hilbert Space}$ of all complex-valued square integrable functions on the interval $[-\pi,\pi]$, i.e. all functions $f: [-\pi,\pi] \to \mathbb{C}$ that satisfy <br>
# $$\int\limits_{-\pi}^{\pi}|f(x)|^2dx < \infty$$ <br>
# or, in other words, the space of real signals that have $\textit{finite energy}$. This arises from the solution of the eigenvalue problem corresponding to the wave equation or heat equation, both of which are PDEs.<br>
# <br>
# Now, all of this theory is great, but what does the DTFT do, exactly? The DTFT can be seen as a way of expressing $\{x_n\}$ as a weighted sum of its harmonics. In other words, the DTFT describes how the total energy of $\{x_n\}$ is distributed amongs the (infinite) individual terms of the sequence. Assuming that it converges, $X(e^{i\omega})$ will be a continous function of $\omega$, as the functions $e^{-in\omega}$ are themselves continuous functions of $\omega$. Therefore, the DTFT can be seen as represernting how the energy of the signal $\{x_n\}$ is distributed across the range of frequencies $\omega \in [-\pi, \pi]$. A more precise mathematical description of this last statement is given by $\textit{Parseval's Theorem}$. <br>
# $$\sum\limits_{n=0}^{\infty}|x_n|^2 = \frac{1}{2\pi}\int\limits_{-\pi}^{\pi}|X(e^{i\omega})|^2d\omega$$ <br>
# The most important property of the DTFT pertianing to our discussion is that it transforms the operation of convolution into multiplication. Before this, we must introduct another important property of the DTFT: If the sequence $h_n$ is shifted by $k$, to generate $h_{n-k}$, then this is the same as multiplying its DTFT $H(e^{i{\omega}})$ by a factor of $e^{-i \omega k}$. This can be verified by direct alegbraic manipulation of the DTFT formula. Let $Y(e^{i\omega})$ denote the DTFT of the result of the convolution $x_n \ast h_n$:<br>
# \begin{align}
#     &Y(e^{i\omega}) = \sum\limits_{n=-\infty}^{\infty}(\sum\limits_{k=-\infty}^{\infty}x_kh_{n-k})e^{-i\omega n} \\
#     &Y(e^{i\omega}) = \sum\limits_{n=-\infty}^{\infty}(\sum\limits_{k=-\infty}^{\infty}x_kh_n(e^{-i \omega k}))e^{-i\omega n} \\
# \end{align} <br>
# Let us assume for a moment that the convergence of the double infinite series above is such that the interchange of the infinite sums does not affect the overall result. This verification is not trivial for general $x_n, h_n$. We will appeal to an exotic area of mathematics called $Distribution Theory$. Distribution theory is a branch of mathematical analysis that encompasses the general theory of objects like the "Dirac delta function" familiar to most students of physics and electrical engineering. This theory gives a result that, informally, states that for essentially all $x_n,h_n$ we would ever encounter(even for "shitty filters"), a weak form of convergence exists that permits the interchange of the infinite sums. <br>
# \begin{align}
#     &Y(e^{i\omega}) = \sum\limits_{k=-\infty}^{\infty}x_k(\sum\limits_{n=-\infty}^{\infty}h_ne^{-i\omega n})e^{-i \omega k} \\
#     &Y(e^{i\omega}) = \sum\limits_{k=-\infty}^{\infty}x_ke^{-i\omega k}(H(e^{i\omega})) \\
#     &Y(e^{i\omega}) = X(e^{i\omega})H(e^{i\omega}) \\
# \end{align}
# <br>
# Digital filters are often characterized by their frequency response, which is the DTFT of $\{h_n\}$, denoted by the function $H(e^{i \omega})$. If the filter is FIR, $H(e^{i \omega})$ is a polynomial in $e^{i \omega}$. <br>
# As can be seen, the DTFT is an infinite series, but a computer does not have inifnite memory. This is a problem if the signals involved are infinite in length, as is the case in communication systems. Thus, if the DTFT were to be evaluated on a computer, it is necessary to compute a truncation of the series. This finite version of the DTFT is called the discrete Fourier transform, or DFT. 
# ### Section II-2: Intro to the DFT
# The DFT can be thought of as sampling the DTFT at uniformly space intervals on the unit circle. If N such points are sampled, then these points are called the Nth roots of unity

# <div>
# <img src="data:image/png;base64," width="512" height="512" align="center"/> 
# </div> 

# This sampling operation can be described algebraically as: <br>
# $$\hat{X_k} = X(e^{i(\frac{2\pi}{N})k}) \text{for} k = 0,1,...,N-1$$ <br>
# <br>
# We are now ready to define the DFT: <br>
# $\textbf{Definition(DFT)}$: Let $\{x_n\}$ be a finite length sequence with length N. The DFT of $\{x_n\}$, denoted by the sequence $\{\ \hat{X_k}\}$, is given by: <br>
# $$\hat{X_k} = \sum\limits_{n=0}^{N-1}x_ne^{-i(\frac{2 \pi}{N})kn} \text{  for  } k=0,1,..,N-1$$ <br>
# <br>
# ### Section II-2: Matrix Representation of the DFT and its Properties
# The formula for the DFT is more easily visualized by its matrix formulation: Let $x = [x_0 x_1 ... x_{N-1}]^T \in \mathbb{C}^N$ denote the vectorial representation of the sequence $\{x_n\}$ and let $\hat{X} = [\hat{X_0} \hat{X_1} ... \hat{X_{N-1}}]^T \in \mathbb{C}^N$ denote the vectorial representation of the discrete Fourier transform of $\{x\}$. $\hat{X}$ is given by
# <br>
# $$ \begin{bmatrix} \hat{X_0} \\ \hat{X_1} \\ \hat{X_2} \\ \vdots \\ \hat{X_{N-1}} \end{bmatrix} = \begin{bmatrix} 1 & 1 & 1 & \ldots & 1 \\ 1 & W_N & W_N^2 & \ldots & W_N^{N-1} \\ 1 & W_N^2 & W_N^4 & \ldots & W_N^{2(N-1)} \\ 
# \vdots & \vdots & \vdots & \ddots & \vdots \\ 1 & W_N^{N-1} & W_N^{2(N-1)} & \ldots & W_N^{(N-1)(N-1)} \end{bmatrix} \begin{bmatrix} x_0 \\ x_1 \\ x_2 \\ \vdots \\ x_{N-1} \end{bmatrix} $$ <br>
# where $W_N = e^{-i(\frac{2\pi}{N})}$. These are collectively called "Twiddle Factors". This can be restated more compactly, with $ \pmb{W} $ denoting the DFT matrix, as <br>
# $$ \hat{X} = \pmb{W}x $$ <br>
# <br>
# The DFT matrix $\pmb{W}$ has several useful properties. One is that it is symmetric. Moreover, it its conjugate symmetric, or $hermitian$, i.e. $\pmb{W} = \overline{\pmb{W^T}} = (\overline{\pmb{W}})^T$ where $T$ denotes transposition and $\overline{\pmb{W}}$ denotes complex conjugation. <br>
# Let $ e_j = [1 W_N^{(1)j} ... W_N^{(k)j} ... W_N^{(N-1)j}]^T $. The DFT matrix $\pmb{W}$ can thus be given by <br>
# $$\pmb{W} = [e_0 e_1 ... e_{N-1}]$$ <br>
# It follows that <br>
# \begin{equation*}
#     <e_j,e_k>=\begin{cases}
#           N \quad &\text{if} \, j = k \\
#           0 \quad &\text{if} \, j \neq k \\
#      \end{cases}
# \end{equation*}
# So the vectors $e_j$ for $ j = 0, 1, ..., N-1$ are orthogonal to each other and also form a spanning set(proof omitted) of $\mathbb{C}^N$. Thus, $\{\frac{1}{\sqrt{N}}e_0 \frac{1}{\sqrt{N}}e_1 ... \frac{1}{\sqrt{N}}e_{N-1}\}$ is an orthonormal basis of $\mathbb{C}^N$. Thus, by the best approximation theorem proved above, the DFT $\{\hat{X_k}\}$ represents the best approximation of $\{x_n\}$ in the finite-dimensional Hilbert space spanned by $\{e_0 e_1 ... e_{N-1}\}$, which is a subspace of $\mathbb{C}^N$. <br>
# It is then a direct consequence that the matrix $\frac{1}{\sqrt{N}}\pmb{W}$ is unitary. This means that, <br>
# $$\frac{1}{N}\pmb{W}\overline{\pmb{W}^T} = \frac{1}{N}\overline{\pmb{W}^T}\pmb{W} = I_N$$ <br>
# where $I_N$ is the $N x N$ identity matrix. The matrix formulation of the DFT can be used to prove all of the DFT properties, which are summarized in the table below <br>

# <div>
# <img src="data:image/png;base64," width="500" height="1200" align="center"/> 
# </div>

# Note that the DFT transform the operation of convolution into termwise multiplication, just like the DTFT does. Thus, once we have computed $\{\hat{X_k}\}$ and $\{\hat{H_k}\}$, computing $\hat{Y_k} = \hat{X_k}\hat{H_k}$ for $ k = 0,1,...,N-1$ is an $O(N)$ operation. $\{y_n\}$ can then be obtained from $\{\hat{Y_k}\}$ by computing the inverse DFT, which is described in Section IV.
# ### Section II-3 Time and Space Complexity of the Explicit Evaluation of the DFT
# It is a well-known fact that the time complexity of matrix-vector multiplication is $O(N^2)$, so the time complexity of direct evaluation of an N-point DFT is $O(N^2)$. The space complexity is also $O(N^2)$ if the matrix is stored explicity, which is not necessary due to symmetry in the twiddle factors. It is actually only necessary to explicity store $W_0, W_1, ... , W_{N-1} $ so the space complexity can be reduced to $O(N)$. Anyway, the time complexity of $O(N^2)$ can result in excessivly long computation times if N is large so an improved algorithm for computing the DFT is necessary fo even moderately large N. Thus, we obtain no computational savings by evaluating the convolution by computing the DFT (and its inverse) explicity. Fortunately, numerous faster algorithms exist for computing the DFT and its inverse.
# ### Section II-4: The Shannon-Nyquist Sampling Theorem and Aliasing
# Before we discuss a class of highly efficient algorithms for computing the DFT, we must first introduce one more very important concept from signals and systems theory, that is, the Shannon-Nyquist sampling theorem. This theorem was published by Claude Shannon at MIT in 1948, building upon the earlier research of Harry Nyquist, a scientist at Bell Labs, in the 1920s. Discrete time signals $\{x_n\}$ do not exist in nature, they must be generated by some man-made process. This process of transforming a continuous-time signal $x(t)$ into a discrete time signal($\{x_n\}$) is called sampling. <br>
# $\textbf{Theorem(Sampling Theorem)}:$Let $x(t)$ be a real signal with continuous time Fourier transform $\hat{X(i\Omega)} = \int\limits_{-\infty}^{\infty}x(t)e^{-2\pi i \Omega t}dt \text{ where } \Omega \in \mathbb{R}$. Suppose that $X(i\Omega)$ is band-limited, i.e., is 0 whenever $|\Omega| > B \text{ for some } B \in \mathbb{R}$. B is denoted as $\Omega_N$ in the picture below. Then, if $x(t)$ is sampled at a rate $\Omega_s$ greater than or equal to 2B to produce $\{x_n\}$, then there exists a process in which $x(t)$ can be recovered from $\{x_n\}$ without any loss of information.

# <div>
# <img src="data:image/png;base64," width="500" height="1200" align="center"/>
# </div>

# A complete discussion of the mathematics involved would take far too long for the pruposes of this presentation. Therefore, we will summarize a bit: Whenever a continous-time signal $x(t)$ with band-limited Fourier transform $X(e^{i\omega})$ is sampled, the sampling operation condenses its entire spectrum, that is, its band-limited Fourier transform, into a "normalized frequency" interval of length $2 \pi$. This spectrum is the DTFT, $X(e^{i\omega})$, and is why the DTFT is defined on an interval of length $2 \pi$. A result of the sampling operation is that periodic copies of the condensed spectrum, with period $\Omega_s$, are made, across the entire real frequency axis. A real analog-to-digital converter would then apply a filtering operation to recover exactly one copy of the spectrum and obtain a finite length $\{x_n\}$. The reason the sampling rate needs to be at least 2B is so the copies of the spectrum $X(e^{i\omega})$ do not overlap in the real frequency domain. as is the case in (c.) in the figure above. Aliasing occurs when copies of the spectrum overlap in the real frequency domain, as is the case in (d.) in the figure above. In this situation, the original signal $x(t)$ cannot be recovered without loss of information, which is undesirable. <br>
# <br>
# A logical question one may ask is what does this have to do with the DFT? The DFT can be viewed as sampling the DTFT in the frequency domain. The DFT samples exist in a finite frequency domain $\{W_N^0, W_N^1, ... , W_N^{N-1}\}$. If $\{x_n\}$ is of finite length, then to reconstruct it after calculating its DFT, the length of the DFT must be at least N. 
# 

# ## Section III: The Cooley-Tukey Radix-2 Decimation In Time Fast Fourier Transform(FFT)
# ### Section III-1: The Original FFT Algorithm
# The problem of devising a more efficient algorithm to compute the DFT was studied for many decades before 1965, when two American mathematicians, James W. Cooley and John Tukey, invented a algorithm for computing the DFT in $O(N \log{N})$ time). This was done by exploiting the conjugate symmetry and periodicity of the twiddle factors $W_N$, to devise a "divide and conquer algorithm for computing the DFT called the Fast Fourier Transform(FFT). For the rest of this presentation, assume N is a power of 2. <br>
# We want to recursively apply the DFT to length N/2 subsquences of the original sequence $x_n$. This is done by splitting the computation into two parts, one of the even-indexed terms and one over the odd-indexed terms: <br>
# \begin{align}
#     &\hat{X_k} = \sum\limits_{n=0}^{N-1}x_nW_N^{nk} \text{   for     } k = 0,1,...,N-1\\
#     &\hat{X_k} = \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n}W_N^{(2n)k} + \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n+1}W_N^{(2n+1)k}\\
#     &\hat{X_k} = \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n}W_{N/2}^{nk} + \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n+1}W_N^{2nk+k}\\
# \end{align}
# \begin{equation*}
# \hat{X_k}=\begin{cases}
#           \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n}W_{N/2}^{nk} + W_N^k\sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n + 1}W_{N/2}^{nk} \quad &\text{if} \, k = 0,1,...,N/2-1 \\
#           \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n}W_{N/2}^{nk} - W_N^k\sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n + 1}W_{N/2}^{nk} \quad &\text{if} \, k = N/2,N/2+1,...,N-1 \\
#      \end{cases}
# \end{equation*}
# Define $\hat{G_k} = \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n}W_{N/2}^{nk}, \hat{H_k}=\sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n}W_{N/2}^{nk} \text{ for k } = 0,1,...,\frac{N}{2} - 1 $ so $ \hat{X_k} $ can be re-written as <br>
# \begin{equation*}
# \hat{X_k}=\begin{cases}
#           \hat{G_k} + W_N^k\hat{H_k} \quad &\text{if} \, k = 0,1,...,N/2-1 \\
#           \hat{G_k} - W_N^k\hat{H_k} \quad &\text{if} \, k = N/2,N/2+1,...,N-1 \\
#      \end{cases}
# \end{equation*}
# This procedure can be recursively applied until the size of the subsequence reaches a base case(usually 2, but can also be 4), at which point the DFT is computed explicitly. The two-point DFT of $\{x_0,x_1\}$ is given by <br>
# $$\{\hat{X_0} = x_0 + x_1, \hat{X_{1}} = x_0 - x_1\} $$ <br>
# The overall procedure for N = 8, which involves two recursions, is shown below: <br>

