# Note the ordering on the $x_n's$ on the left. The ordering shown is after all of the initial recursions are complete, which is perhaps more clearly explained by the code below. The above graph shows the recursive "reassembly" of the decimated $x_n's$ into the $X_k's$

# #### Python3 Implementation of Cooley-Tukey Decimation In Time FFT Algorithm

# In[2]:


def ogfft(x, N):
    """
    Recurisve radix-2 FFT implementation directly from divide-and-conquer description
    """
    PI = np.pi
    if N == 2:
        return np.array([x[0] + x[1], x[0] - x[1]])
    else:
        m = int(N/2)
        big_G = ogfft(x[0:N:2],m) 
        big_H = ogfft(x[1:N:2],m)
        w = np.exp((-2.0*PI*1.0j)/N)
        d = np.power(w, np.arange(m))
        d = np.multiply(d, big_H)
        X = np.concatenate((big_G + d, big_G - d))
        return X


# In[3]:


def brc(x):
    """
    Returns bit-reversed order copy of array x
    """
    N = len(x)
    y = np.zeros(N, dtype=complex)
    width = int(np.log2(N))
    for ii in np.arange(N):
        idx = '{:0{width}b}'.format(ii, width=width)
        y[ii] = x[int(idx[::-1],2)]#Reverse order of bits of integer ii
    return y


# In[12]:


def ogfft2(x, N):
    """
    In-place, non-recursive implementation of radix-2 Cooley-Tukey decimation in time FFT algorithm
    """
    x_p = brc(x)
    PI = np.pi
    for ii in np.arange(1,int(np.log2(N)) + 1):
        M = int(2**ii)
        w_M = np.exp(1j*((2*PI)/M))
        for kk in np.arange(0,N,M):
            w = 1
            m = int(M/2)
            for jj in np.arange(m):
                t = w*x_p[kk + jj + m]
                u = x_p[kk + jj]
                x_p[kk + jj] = u + t
                x_p[kk + jj + m] = u - t
                w = w*w_M
    return x_p
        


# ### Section III-2: Time and Space Complexity of the Radix 2 FFT
# The function ogfft2() reveals the time and space complexity of the radix-2 FFT. The array x needs to be copied into its bit-reversed order, so the space complexity is $O(N)$. It is possible to do this independently of the FFT iteration/recursion, so the FFT by itself has a space complexity of $O(1)$. The function brc() that does the bit reverse ordering clearly has a time complexity of $O(N\log{N})$ as it iterates through the entire list, and the reversal takes $O(\log{N})$ operations. <br>
# Let F(n) denote the number of times the innermost for loop of ogfft2() is executed: The code block containing the inner most for loops will run $\frac{N}{M}=\frac{N}{2^{i}}$ times for each value of i. The innermost for loop will then run $2^{i-1}$ times. Thus, the time complexity is given by <br>
# $$ F(n) = \sum\limits_{i=1}^{\log_2{N}} \frac{N}{2^i}(2^{i-1}) = \sum\limits_{i=1}^{\log_2{N}}\frac{N}{2} = O(N\log_2{N}) $$ <br>
# Thus, the time complexity of computing the DFT can be reduced from $O(N^2)$ to $O(N\log{N})$, a huge reduction. This discovery is considered to be one of the most important developments in applied mathematics in the past six decades, and is one of the reasons why we have many technologies, such as LTE and 5G wireless communications, and Praveen's horseback riding radios, today.  

# ## Section IV: Other Radix-2 FFT Algorithms
# ### Section IV-1: FFT For Purely Real Data: The Fast Hartley Transform(FHT)
# The FFT subroutines implemented above are designed to operate on complex numbers. This is necessary in many applications, such as radar processing and optical filter design. In other applications of the FFT however, such as audio processing, or constructing a fast subroutine for the multiplication of real-valued polynomials, it is only necessary to apply the FFT to real data. This is done by changing the basis of the DFT matrix from one having complex exponentials to one having real-valued functions. One way of doing this is to use the following orhtogonal basis for $R^{N}$: <br>
# $$\{H_0 H_1 ... H_{N-1}\},  \text{ where } H_j = [1 H_N^{(1)j} ... H_N^{(k)j} ... H_N^{(N-1)j}]^T $$. <br>
# where $N \in \mathbb{Z}^+$ and $H_N^k$ is given by <br>
# $$H_N^k = \cos{(\frac{2 \pi}{N}k)} + \sin{(\frac{2 \pi}{N}k)} \text{ for k = 0,1,...,N-1}$$ <br>
# $H_N^k$ satisifies the following crucial identity: <br>
# $$H_N^{j+k} = C_N^{k}H_N^{j} + S_N^{k}H_N^{-j}$$ <br>
# where $C_N^{k} = \cos{(\frac{2 \pi}{N}k)}$ and $S_N^{k} = \sin{(\frac{2 \pi}{N}k)}$ <br>
# Define the discrete Hartley transform(DHT) of a length N sequence $\{x_n\}$ to be the sequence $\{X^{H}_k\}$, given by<br>
# $$X^{H}_k = \sum\limits_{n=0}^{N-1}x_nH_N^{nk} \text{   for     } k = 0,1,...,N-1$$ <br>
# Using the identity, a recursive decimation-in-time algorithm for when N is a power of 2 similar to the FFT can be derived to efficiently compute the DHT: <br>
# \begin{align}
#     &X^{H}_k = \sum\limits_{n=0}^{N-1}x_nH_N^{nk} \text{   for     } k = 0,1,...,N-1\\
#     &X^{H}_k = \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n}H_N^{(2n)k} + \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n+1}H_N^{(2n+1)k}\\
#     &X^{H}_k = \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n}H_{N/2}^{nk} + \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n+1}H_N^{2nk+k}\\
#     &X^{H}_k = \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n}H_{N/2}^{nk} + \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n+1}
#      (C_N^{k}H_{N/2}^{nk} + S_N^{k}H_{N/2}^{-nk})\\
#     &X^{H}_k = \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n}H_{N/2}^{nk} + C_N^k(\sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n+1}H_{N/2}^{nk}) + S_N^k(\sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n+1}H_{N/2}^{-nk})
# \end{align}
# Remember to evaluate terms with negative indices modulo $\frac{N}{2}$. <br>
# The Python function below implements the above procedure, which is called the Fast Hartley Transform(FHT). Many FFT implementations that are designed to operate with purely real input such as Numpy's rfft() do not employ the FHT, but the FHT captures the general idea of how to construct such FFTs for purely real data. The time complexity of the FHT is identical to that of the FFT, $O(N \log{N})$ but fewer total operations will be perfomed as we will be adding/multiplying real and not complex numbers. The space complexity can be reduced to $O(1)$ by storing a "lookup table" of the values of sines and cosines needed before the computation takes place and use of clever indexing.

# In[25]:


def fht(x, N):
    """
    Perform recursive radix-2 FHT on real input vector x
    """
    if N == 2:
        return np.array([x[0] + x[1], x[0] - x[1]])
    else:
        m = int(N/2)
        y_t = fht(x[0:N:2],m) 
        y_b = fht(x[1:N:2],m)
        H_N_C = np.cos((2*PI*np.arange(m))/N)
        H_N_S = np.sin((2*PI*np.arange((m)))/N)
        idx_map = np.concatenate(([0], np.arange(m - 1, 0, -1)))
        y_1 = y_t + np.multiply(H_N_C,y_b) + np.multiply(H_N_S, y_b[idx_map])
        idx_map = np.concatenate(([0], np.arange(m - 1, 0, -1)))#Modulo N/2
        y_2 = y_t - np.multiply(H_N_C,y_b) - np.multiply(H_N_S, y_b[idx_map])
        y = np.concatenate((y_1, y_2))
        return y


# ### Section IV-2: FFT With Purely Imaginary Twiddle Factors: The Rader-Brenner Radix-2 FFT
# In 1976 Rader and Brenner devised an alternative formulation for the radix-2 decimation in time FFT using purely imaginary twiddle factors. This substantially cuts down the total number of multiplcation operations performed, as all of the multiplications will include at most one complex number. This comes at a cost of an increased number of real addition operations. <br>
# Let $\{x_n\}_{n=0}^{N-1}$ be a complex sequence and let $N$ be a power of 2. Define the finite subsequences $<br>$
# \begin{align}
#     &y_{t_n} = x_{2n} \text{ for } n = 0,2,...,\frac{N}{2}-1 \\
#     &y_{b_n} = x_{2n+1} - x_{2n-1} + q \text{ for } n = 1,3,...,\frac{N}{2}-1 
# \end{align}
# where $q = \frac{2}{N} \sum\limits_{n=0}^{\frac{N}{2}-1}x_{2n+1}$. <br>
# q is a constant, so it appears in only one term, $y_{b_0} = x_{\frac{N}{2}}$. <br>
# Using periodicity and some properties of the complex exponential $W_N^k = e^{-i\frac{2 \pi}{N}k}$, we can derive, for $k = 1,2,..., \frac{N}{2} - 1$ <br>
# \begin{align}
#     &Y_{b_k} = \sum\limits_{n=0}^{N/2 - 1}x_{2n+1}W_{N/2}^{nk} - \sum\limits_{n=0}^{N/2 - 1}x_{2n-1}W_{N/2}^{nk} \\
#     &Y_{b_k} = \sum\limits_{n=0}^{N/2 - 1}x_{2n+1}W_{N/2}^{nk} - \sum\limits_{n=0}^{N/2 - 1}x_{2n-1}(W_{N/2}^{0})W_{N/2}^{nk} \\
#     &Y_{b_k} = \sum\limits_{n=0}^{N/2 - 1}x_{2n+1}W_{N/2}^{nk} - \sum\limits_{n=0}^{N/2 - 1}x_{2n+1}(W_{N/2}^{2k})W_{N/2}^{nk} \\
#     &Y_{b_k} = \hat{X_{2k + 1}}(1 - W_{N/2}^{2k}) \\
#     &Y_{b_k} = \hat{X_{2k + 1}}(-W_{N/2}^{k})(W_{N/2}^{k} - W_{N/2}^{-k}) \\
#     &Y_{b_k} = \hat{X_{2k + 1}}(W_{N/2}^{k})(2i\sin{\frac{4 \pi}{N}}) \\
#     &W_{N/2}^{k}\hat{X_{2k + 1}} = \frac{\hat{Y_{b_k}}}{2i\sin{\frac{4 \pi}{N}}} \\
# \end{align}
# Therefore,
# \begin{equation*}
# \hat{Y_k}=\begin{cases}
#           \hat{Y_{t_0}} + \hat{Y_{t_0}} \quad &\text{if} \, k = 0 \\
#           \hat{Y_{t_0}} + \frac{\hat{Y_{b_k}}}{2i\sin{\frac{4 \pi}{N}}} \quad &\text{if} \, k = 1,2,...,\frac{N}{2}-1 \\
#           \hat{Y_{t_0}} - \hat{Y_{t_0}} \quad &\text{if} \, k = \frac{N}{2} \\
#           \hat{Y_{t_0}} - \frac{\hat{Y_{b_k}}}{2i\sin{\frac{4 \pi}{N}}} \quad &\text{if} \, k = \frac{N}{2} + 1, \frac{N}{2} + 2,...,N-1 \\
#      \end{cases}
# \end{equation*}
# A recursive Python3 implementation of this algorithm is shown below.

# In[6]:


def fftRB(x, N):
    """
    Perform recursive radix-2 Rader-Brenner FFT on input vector x

    x: Input vector/array
    N: Length of input vector, must be a power of 2
    """
    if N == 2:
        return np.array([x[0] + x[1], x[0] - x[1]])
    else:
        m = N // 2
        y_t = fftRB(x[0:N:2],m)
        x_b = x[1:N:2]
        q = (2.0/N)*np.sum(x_b)
        b_n = x_b - np.concatenate(([x_b[m-1]], x_b[0:(m-1)])) + q
        y_b = fftRB(b_n,m)
        w_ky_b = np.multiply(y_b[1:m], 1.0/(2.0j*np.sin((2*PI*np.arange(1,m))/N)))
        y = np.concatenate(([y_t[0] + y_b[0]], y_t[1:m] + w_ky_b, [y_t[0] - y_b[0]], y_t[1:m] - w_ky_b))
        return y


# ### Section IV-3: Cooley-Tukey Radix-2 Decimation In Frequency Algorithm
# The previously defined FFT algorithms share one common feature: the sequence $\{x_n\}$ of length N is split into two smaller subsequences of length $\frac{N}{2}$ before the call to fft() is applied. The smaller DFT/FFT sequences are then combined to form the overall length N DFT/FFT $\{\hat{X_k}\}$. In other words, the decimation of $\{x_n\}$ is done in the time domain. What if instead the decimation can instead be done in the frequency domain?. This is indeed possible, and FFT algorithms that employ this technique are called decimation-in-frequency algorithms. The formulas that describe the radix-2 decimation in frequency algorithms can be derived, a bit less rigorously, from the decimation in time formulas using the transposition theorem of signal flow graphs. If the input and output nodes of the signal flow graph in Section III-1 are interchanged and the direction of each branch in flipped, we arrive at the signal flow graph for N=8 and equations below: <br>
# \begin{align}
#     &\hat{X_{2k}}= \sum\limits_{n=0}^{\frac{N}{2}-1}(x_{n} + x_{n+N/2})W_{N/2}^{nk} \text{ for k } = 0,1,...,N/2-1 \\
#     &\hat{X_{2k+1}}= \sum\limits_{n=0}^{\frac{N}{2}-1}(x_{n} - x_{n+N/2})W_{N}^nW_{N/2}^{nk} \text{ for k } = 0,1,...,N/2-1 \\    
# \end{align}

# <br>
# <div>
# <img src="data:image/png;base64," width="512" height="512" align="center"/> 
# </div> <br>

# The decimation in frequency formulas can also be derived using the sampling theorem: Splitting $\{\hat{X}_k\}$ into two smaller sequences effectively reducesthe sampling rate by 1/2. Therefore, there will be aliasing when $\{x_n\}$ is reconstructed from $\{\hat{X}_k\}$. The even-index samples of $\{\hat{X}_k\}$ are not circularly shifted. Therefore, we do two copies of its inverse DFT $\{x_{2n}\}$ will lie in the interval $0 \leq n \leq \frac{N}{2} - 1$, itself and itself shifted by $\frac{N}{2}$. Let $\{x_{2n}\}$ denote the even indexed samples of $\{x_n\}$. They are given by: <br>
# $$x_{2n} = x_n + x_{n + N/2} \text{ for } n=0,1,..,N/2-1$$
# The odd-indexed terms $\{\hat{X}_{2k+1}\}$ are each circularly shifted by one. By the circular shifting peoperty of the DFT and the effect of time-domain aliasing, we arrive at: <br>
# $$x_{2n+1} = x_nW_N^n + x_{n + N/2}W_N^{n + N/2} = (x_n - x_{n + N/2})W_N^n $$
# An in-place Python3 implementation is shown below. Note the similarity to the in-place decimation in time FFT algorithm, including the placement of the call the brc().

# In[7]:


def ogfftf(x, N):
    """
    Performs in-place Cooley-Tukey radix-2 decimation in frequency FFT
    """
    m = N // 2
    for ii in np.arange(1,int(np.log2(N)) + 1):
        M = N // (2**(ii-1))
        for kk in np.arange(0,N,M):
            for jj in np.arange(m):
                idx = jj + kk 
                p = (2**(ii-1))*jj
                w = np.exp(-1j*2*PI*(p/N))
                x_0 = x[idx] + x[idx + m]
                x_1 = (x[idx] - x[idx + m])*w
                x[idx] = x_0
                x[idx + m] = x_1
        m = m // 2
    return brc(x)


