# ## Section V: The Inverse FFT(IFFT)
# ### Section V-1: Inverse DFT
# To perfrom the complete filtering operation mentioned in Section I-1, we need to calculate the DFT of the s the sequences $\{x_n\}_{n=0}^{N-1}$ and $\{h_n\}_{n=0}^{N-1}$ into the 
# $$x_n = \frac{1}{N}\sum\limits_{k=0}^{N-1}\hat{X_k}W_N^{-kn} \text{ for } n = 0,1,...,N-1$$ <br>
# As mentioned in Section II-2, the inverse of the DFT matrix $\pmb{W}$ is given by $\frac{1}{N}\overline{\pmb{W}^T}$. <br>
# The inverse DFT operation can be described using matrices and vectors as <br>
# $$x = \frac{1}{N}\overline{\pmb{W}^T}\hat{X}$$ 
# This suggests that, with a few algebraic manipulations to $\{\hat{X_k}\}$ one can use the forward FFT to compute the inverse FFT. This is extremely advantageous in hardware implementations of the FFT. We will study two of the most common approaches for doing this.
# ### Section V-2: Computing the Inverse FFT Using Conjugation and Forward FFT
# The above matrix-vector formulation of the inverse DFT suggests a method for computing the IFFT. By using the conjugation property of the DFT and some complex number manipulation, we arrive at the formula <br>
# $$x_n = \frac{1}{N}\sum\limits_{k=0}^{N-1}\overline{\hat{X_k}}W_N^{nk} \text{ for } n = 0,1,...,N-1$$ <br>
# This approach is used to construct an inverse FFT subroutine in Python3 using the in-place forward FFT subroutine ogfft2() from section II-2

# In[13]:


def ogifft2(x_hat, N):
    """
    Perform radix-2 inverse FFT on transform vector x_hat

    x_hat: Input vector/array
    N: Length of input vector, must be a power of 2
    """
    x_hat_star = np.conjugate(x_hat)
    y_star = ogfft2(x_hat_star, N)
    y = (1.0/N)*np.conjugate(y_star)
    return np.real_if_close(y)


# In[16]:


x = np.array([-0.5, 2.2, 3.7, 2.1j, 5.6, -3.3, 16.7, 8.8], dtype=complex)
x_og = np.copy(np.real_if_close(x))
N = len(x)
x_hat = ogfft2(x, N)
y = ogifft2(x_hat, N)
print(x_og)
print(np.real_if_close(y))


# Since the forward FFT can be computed with a time complexity of $O(N \log{N})$ and with a space complexity of $O(1)$, so can the inverse FFT.

# ### Section V-3: Computing the inverse FFT By Interchanging the Real and Imaginary Parts and Forward FFT
# It follows by properties 11-14 in the table of DFT properties that $\{x_n\}$ can be obtained from $\{\hat{X_k}\}$ by interchanging the real and imaginary parts of $\{\hat{X_k}\}$, computing the forward DFT of $\{\hat{X_k}\}$ and scaling by $\frac{1}{N}$, and then interchanging the real and imaginary parts of $\{\hat{\hat{X_k}}\}$ to recover $\{x_n\}$. 

# <div>
# <img src="data:image/png;base64," width="512" height="512" align="center"/> 
# </div>

# In[17]:


def ogifft2R(x_hat, N):
    """
    Perform radix-2 inverse FFT on transform vector x_hat
    by interchanging real and imaginary parts

    x_hat: Input vector/array
    N: Length of input vector, must be a power of 2
    """
    x_hat = np.imag(x_hat) + 1j*np.real(x_hat)
    y_star = ogfft2(x_hat, N)
    y = (1.0/N)*(np.imag(y_star) + 1j*np.real(y_star))
    return np.real_if_close(y)
    


# In[18]:


x = np.array([-0.5, 2.2, 3.7, 2.1j, 5.6, -3.3, 6.7, 8.8], dtype=complex)
x_og = np.copy(np.real_if_close(x))
N = len(x)
x_hat = ogfft2(x, N)
y = ogifft2R(x_hat, N)
print(x_og)
print(y)


# ### Section V-4: Inverse Fast Hartley Transform(IFHT)
# Deriving the inverse of the Hartley transform is straightforward. As mentioned earlier, the Hartley matrix $\pmb{H} = [H_0 H_1 \ldots H_{N-1}]$ has orthogonal columns, as the column vectors $H_j = [1 H_N^{(1)j} \ldots H_N^{(N-1)j}]^T \text{ for } j = 0,1,...,N-1$ are orthogonal. By using the normalization constant $\frac{1}{\sqrt{N}}$, $\{H_0, H_1, \ldots, H_{N-1}\}$ can be made into an orthonormal basis. Since $\pmb{H}$ is real-valued, it follows that <br>
# $$\frac{1}{N}\pmb{H}\pmb{H^T} = I_N$$ <br>
# So $H^T$ is the inverse of H (ignoring the factor $\frac{1}{N}$). By the properties of sine and cosine, it follows that $\pmb{H}$ is symmetric. Thus, barring the factor of $\frac{1}{N}$, $\pmb{H}$ is its own inverse. Thus, the inverse Hartley transform of $\{\hat{X}^H_k\}$ can be computed by taking its forward Hartley transform, and then scaling by 1/N.

# In[28]:


def ifht(x_hat, N):
    """
    Perform radix-2 inverse FHT on real transform vector x_hat

    x_hat: Input vector/array
    N: Length of input vector, must be a power of 2
    """
    y = (1.0/N)*fht(x_hat,N)
    return y


